import styled from "styled-components";

const InputSec = styled.section`
    display: flex;
    justify-content: center;
`

const InputTodo = styled.input`
    margin-top: 15px;
    width: 50%;
    min-height: 60px;
    border-radius: 20px;
    font-size: 20px;
    text-align: center;
    background-color: white;
`

function CreateTodo () {

    return (
        <InputSec>
            <InputTodo placeholder="할일쓰슈 💬" />
        </InputSec>
    )
}

export default CreateTodo;
